package com.example.Quora.models;import jakarta.persistence.*;import lombok.*;import java.util.List;@Entity@Getter@Setter@NoArgsConstructor@AllArgsConstructor@Builderpublic class User {    @Override    public String toString() {        return "User{" +                "id=" + id +                ", name='" + name + '\'' +                ", email='" + email + '\'' +                ", username='" + username + '\'' +                ", password='" + password + '\'' +                ", questions=" + questions +                ", comments=" + comments +                ", likes=" + likes +                ", answers=" + answers +                '}';    }    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private  Long id;    @Column(nullable = false)    private String name;    @Column(nullable = false, unique = true)    private String email;    @Column(nullable = false, unique = true)    private String username;    @Column(nullable = false)    private String password;    @OneToMany(mappedBy = "user")    private List<Question> questions;    @OneToMany(mappedBy = "user")    private List<Comment> comments;    @OneToMany(mappedBy = "user")    private List<Like> likes;    @OneToMany(mappedBy = "user")    private List<Answer> answers;}